import React from 'react';
import { useSelector } from 'react-redux';
import Header from '../components/header';

const SettingPage = () => {
  const user = useSelector((state) => state.userStore.user)

  return (
    <React.Fragment>
      <Header />
      <p>{user.name}</p>
      
    </React.Fragment>
  );
};

export default SettingPage;
